import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Herosection from './components/Herosection';
import About from './components/skills';
import Project from './components/Project';
import Footer from './components/Footer';
import Nostraoverview from './components/nostraoverview';
import './App.css'

function App() {
  return (
    <div className="App">
      <Header />
        <Herosection />
        <About />
        <Project />
      <Router>
        <Routes>
            {/* <Route path="/nostraoverview" element={<React.Fragment><Click /><Nostaoverview /></React.Fragment>} /> */}
            <Route path='/nostraoverview' element={<Nostraoverview />}></Route>
        </Routes>

      </Router>
    </div>
  );
}

export default App;
